import React, { useState } from "react";
import "./index.css"; // Import CSS file

const App = () => {
  // State untuk menyimpan nilai input username dan password
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");

  // Handler ketika form login disubmit
  const handleSubmit = (e) => {
    e.preventDefault(); // Menghentikan pengiriman form secara default (refresh halaman)
    // Lakukan sesuatu dengan nilai username dan password, misalnya kirim ke server
    console.log("Username:", username);
    console.log("Password:", password);
    // Reset nilai input setelah form disubmit (opsional)
    setUsername("");
    setPassword("");
  };

  return (
    <div className="container">
      {/* Header */}
      <div className="header-wrapper">
        <h1>
          Free <strong>Social & MySQL Login</strong> Wizard
        </h1>
        <div className="description">
          <p>
            This is a free Social & MySQL Login form wizard. Download it on{" "}
            <a href="http://أحمدفتحى.blogspot.com/" target="_blank">
              <strong>Elm0D</strong>
            </a>
            , customize and use it as you like!
          </p>
        </div>
      </div>

      {/* Body */}
      <div className="content-wrapper">
        <div className="sub-main">
          <h2 className="sub-heading">Login to our site</h2>

          {/* Form login */}
          <div className="login">
            <p className="span line-left">Enter your email and password.</p>
            <form onSubmit={handleSubmit}>
              <input
                type="text"
                className="user active"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                placeholder="User name"
              />
              <input
                type="password"
                className="lock active"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                placeholder="Password"
              />
              <div className="forgot">
                <div className="login-check">
                  <input type="checkbox" id="brand1" value="" />
                  <label htmlFor="brand1">
                    <span></span>Keep me Signed in
                  </label>
                </div>
                <a href="reset.html"> Forgot Password? </a>
                <div className="clear"></div>
              </div>
              <div className="login-bwn">
                <input type="submit" value="Log in" />
              </div>

              {/* Tombol untuk pindah ke halaman register */}
              <div className="login-bottom">
                <h4>Don't have an Account?</h4>
                <div className="reg-bwn">
                  <a href="register.html">Register Now!</a>
                </div>
              </div>
            </form>
          </div>
          {/* Akhir form login */}
        </div>
      </div>

      {/* Footer */}
      <div className="footer-wrapper">
        <div className="footer">{/* Isi footer */}</div>
        <div className="copyright">
          <p>
            <strong>COPYRIGHT &#169; 2018</strong>
            <a href="http://أحمدفتحى.blogspot.com/" target="_blank">
              <b>Elm0D</b>
            </a>
          </p>
        </div>
      </div>
    </div>
  );
};

export default App;
